DROP SCHEMA IF EXISTS const;
create schema const;

create table const.yesno
(
	id int not null,
	primary key(id),
	name varchar(5)
);


create table const.gender
(
	id int not null,
	primary key(id),
	name varchar(10)
);


create table const.name_lengh
(
	id int not null,
	primary key(id),
	name varchar(20)
);


create table const.name_type
(
	id int not null,
	primary key(id),
	name varchar(30)
);

create table const.name_religion
(
	id int not null,
	primary key(id),
	name varchar(20)
);


create table const.name_regularity
(
	id int not null,
	primary key(id),
	name varchar(20)
);



DROP TABLE IF EXISTS app.names;
DROP SCHEMA IF EXISTS app;
CREATE SCHEMA app;

--name, gender, name_type, name_length, name_common, rating
create table app.names
(
	id SERIAL not null,
	primary key(id),
	name varchar(50) not null,
	gender int  null,
	religion int null,
	name_type int  null,
	is_ilir int null,
	name_length int  null,
	regularity int  null,
	meaning varchar(400) null,
	rating int
);

